import React, { Component } from "react";
import {
  Card,
  // CardBlock,
  // CardFooter,
  // CardTitle,
  // CardText,
} from 'react-bootstrap-card';
// import {
//   Col,
//   Row,
// } from 'react-bootstrap';
import HoverImage from "react-hover-image";
import "./portfolio";

class Portfolio extends Component {
  // contructor(props) {
  //   super(props);
  //   this.state = {};
  // }

  render() {
    return (
      <body>
        <div className="container">
          <div className="row">
            <div className="col-12 col-md-12 col-lg-12">
              <h2>Portfolio</h2>
            </div>
            <hr width="1100" />
          </div>
          <Card style={{ width: "18rem" }}>
            <Card.Body>
              <Card.Title>COMMUTE\buddy\</Card.Title>
              <Card.Subtitle className="mb-2 text-muted">
                a commuting application for everyone </Card.Subtitle>
                <Card.Img variant="top" src="./images/commuteBuddy.png" />
              <Card.Link href="#">Card Link</Card.Link>
              <Card.Link href="#">Another Link</Card.Link>
            </Card.Body>
          </Card>
          <div className="row">
            <div className="col-6">
              <HoverImage
                className="d-block w-100"
                src="./images/commuteBuddy.png"
                hoverSrc={"https://magiama9.github.io/commute-buddy/"}
              />
              <div className="inner-div">
                <p>COMMUTE\buddy\: a commuting application for everyone. </p>
                <p>
                  Live Website:{" "}
                  <a href="https://magiama9.github.io/commute-buddy/">
                    COMMUTE\buddy\
                  </a>
                </p>
                <p>
                  GitHub Code:{" "}
                  <a href="https://github.com/aya828/commute-buddy/">
                    COMMUTE\buddy\
                  </a>
                </p>
              </div>
            </div>
          </div>
        </div>
      </body>
    );
  }
}

export default Portfolio;
